#!/bin/bash

# Example script on how to deploy your own dip20 token

# cd src/DIP20/
#remove old content
# dfx stop
# rm -rf .dfx

LOGOURI="data:image/jpeg;base64,"

#create canisters
dfx canister create --all --network ic
# create principal id that is inital owner of tokens

##ROOT_HOME=$(mktemp -d)
ROOT_PUBLIC_KEY="principal \"$(dfx identity get-principal)\""

#build token canister
dfx build --network ic
# deploy token
# eval dfx canister install token --argument="'(\"tendy.jpg\", \"Tendies\", \"TENDY\", 8, 88000, $ROOT_PUBLIC_KEY, 10000)'"
eval dfx canister install token --argument="'(\"$LOGOURI\", \"Tendies\", \"TENDY\", 8, 8800000000000, $ROOT_PUBLIC_KEY, 420)'" --network ic
# --mode reinstall 

# set fee structure. Need Home prefix since this is location of our identity
dfx canister  call token setFeeTo "($ROOT_PUBLIC_KEY)" --network ic
#deflationary
dfx canister  call token setFee "(420)"  --network ic
# get balance. Congrats you are rich
# HOME=$ROOT_HOME dfx canister --no-wallet call token balanceOf "($ROOT_PUBLIC_KEY)"
dfx canister call token balanceOf "($ROOT_PUBLIC_KEY)" --network ic
